    false,nt"url": null,nt"notes": "This report covers systematic surveys for
    upland birds were conducted by the Wyoming Natural Diversity Database in 2009. The
    refuges were surveyed using the point-count method during migration and breeding
    seasons. Results from these surveys are presented here and serve as a baseline measure
    of the upland avifauna. If rolled into a long-term monitoring program, these methods
    could be repeated and compared with regional monitoring efforts to evaluate the
    roles of the refuges in supporting bird populations in the ecoregion.",nt"license_title":
